css:
@-moz-document domain(www.junat.net) {
 
html {
overflow:hidden;
}

th.l.hidden-small {
    background-color: #d9d9d9;
}

th.s.center {
    background-color: #d9d9d9;
    border-color: #000000;
    border-style: solid;
}

th.m {
    background-color: #d9d9d9;
    color: #5bbbf7;
    border-width: 1px;
}

th.s {
    background-color: #d9d9d9;
    color: #5bbbf7;
}

time.hidden-small {
    color: #7a7a7a;
}

td.hidden-small.estimate {
    background-color: #f2f2f2;
}

td.center {
    background-color: #f2f2f2;
}

#board tr td {
    background-color: #f2f2f2;
    color: #5c5c5c;
}

tr td a {
    color: #7a7a7a;
}

div.mode-selectors a {
    height: 0;
    width: 0;
}

div.mode-selectors {
    height: 0;
    width: 0;
}

#q {
    color: #5bbbf7;
    background-color: #ffffff;
    display: none;
}


}
